import "./style.scss";
import Register from "./pages/Register";
import Home from "./pages/Home";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path={"/"}>
          <Route></Route>
        </Route>
      </Routes>
      <Register />
    </BrowserRouter>
  );
}

export default App;
